    def handle_data(self, timeL, kettleL, turboL):
        timeL_kettle = timeL
        timeL_turbo = timeL.copy()

        zscore_kettleL = list(stats.zscore(kettleL))
        zscore_turboL = list(stats.zscore(turboL))

        for value_z in zscore_kettleL:
            if abs(value_z) > 3:
                index_zc = zscore_kettleL.index(value_z)

                timeL_kettle.pop(index_zc)
                kettleL.pop(index_zc)

        for value_z in zscore_turboL:
            if abs(value_z) > 3:
                index_zc = zscore_turboL.index(value_z)

                timeL_turbo.pop(index_zc)
                turboL.pop(index_zc)

        quan_void_kettle = kettleL.count(-10)
        quan_void_turbo = turboL.count(-10)

        for i in range(quan_void_kettle):
            index_void = kettleL.index(-10)

            kettleL.pop(index_void)
            timeL_kettle.pop(index_void)

        for i in range(quan_void_turbo):
            index_void = turboL.index(-10)

            turboL.pop(index_void)
            timeL_turbo.pop(index_void)

        return timeL_kettle, timeL_turbo, kettleL, turboL

